import React from 'react';
import ProductsInDB from './ProductsInDB';
import AmountOfProductsInDB from './AmountOfProductsInDB';
import AmountOfUsersInDB from './AmountOfUsersInDB';

function ContentRowTop(){
    return (
        <div className="row">
        {/* <!-- Products in DB --> */}
            <ProductsInDB titulo='PRODUCTS IN DATA BASE' cifra='135' color='--blue' icon='' />

        {/* <!-- $$$ of all products in DB --> */}
            <AmountOfProductsInDB titulo='AMOUNT IN PRODUCT' cifra='$546.456' color='--green' icon=''  />

        {/* <!-- Amount of users in DB --> */}
            <AmountOfUsersInDB titulo='USERS QUANTITY' cifra='38' color='--yellow' icon='' />
    </div>
    )
}

export default ContentRowTop;
